import "./App.css";




const Header = () => {
  return(
    <div className="header"></div>
  );
}
const Navi = () => {
  return(
    <div className="navi"></div>
  );
}
const Body = () => {
  return(
    <div className="body"></div>
  );
}
const Footer = () => {
  return(
    <div className="footer"></div>
  );
}
const Section = () => {
  return(
    <div className="Section"></div>
  );
}
const Side = () => {
  return(
    <div className="side"></div>
  );
}


function App() {
  return (
    <div className="container">
      <Header/>
      <Navi />
      <Body></Body>
      <Footer/>
      </div>
  );
}

export default App;
